@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:TransactionRequest a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:hasAccount ;
        owl:someValuesFrom atm:Account
    ] ,
    [
        a owl:Restriction ;
        owl:onProperty atm:hasAmount ;
        owl:someValuesFrom xsd:decimal
    ] .

atm:ProcessTransaction a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:processes ;
        owl:someValuesFrom atm:TransactionRequest
    ] .

atm:hasAccount a owl:ObjectProperty ;
    rdfs:domain atm:TransactionRequest ;
    rdfs:range atm:Account .

atm:hasAmount a owl:DatatypeProperty ;
    rdfs:domain atm:TransactionRequest ;
    rdfs:range xsd:decimal .

atm:processes a owl:ObjectProperty ;
    rdfs:domain atm:ProcessTransaction ;
    rdfs:range atm:TransactionRequest .

atm:Account a owl:Class .

atm:BankComputer a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:processes ;
        owl:someValuesFrom atm:ProcessTransaction
    ] .
